vector<int> load_braid(int i) {
	vector<int> res;
	std::stringstream ss;
	ss << "obfuscated_braids/" << i << ".txt";
	ifstream inputFile(ss.str());
   
	if (inputFile) {        
	    int value;
  
	    while ( inputFile >> value ) {
	        res.push_back(value);
	    }
	return res;
	}
}

void apply_R_gate(char * registers, int i) {
	int r1 = registers[i];
	int r2 = registers[i+1];
	int t = R[r1][r2];

	registers[i] = r2;
	registers[i+1] = t;
}

void apply_Rinv_gate(char * registers, int i) {
	int r1 = registers[i];
	int r2 = registers[i+1];
	int t = Rinv[r1][r2];
	registers[i+1] = r1;
	registers[i] = t;
}

bool evaluate(vector<bool> arr, int circuit_idx) {
	char registers[N] = {42, 24, 21, 59, 39, 22, 41, 44};
	for(int i = 0; i < 64; ++i) {
		registers[8 + 2 * i] = 40;
		registers[8 + 2 * i + 1] = 20;
	}

	for(int i = 0; i < m; ++i) {
		if(arr[i] == 1) {
			registers[8 + 2 * i] = 20;
			registers[8 + 2 * i + 1] = 40;
		}
	}

	vector<int> circuit = load_braid(circuit_idx);
	for (size_t i = 0; i < circuit.size(); i++) {
		int I = circuit[i];
		if(I > 0) apply_R_gate(registers, I-1);
		else apply_Rinv_gate(registers, (-I) - 1);
	}

	return ((registers[N-2] == 20) && (registers[N-1] == 40));	
}

vector<bool> quad_to_bits(string s) {
	int x = 0;
	const char * cs = s.c_str();
	for(int i = 3; i >= 0; --i){
		x += ((int) cs[i]) << (8 * (3 - i));
	}

	vector<bool> res(m, 0);
	for(int i = 0; i < m; ++i) {
		res[i] = (x >> i) & 1;
	}
	return res;
}

int main() {
	string flag;
	cin >> flag;
	if(flag.length() != 24) {
		cout << "Incorrect!" << endl;
		return 0;
	}

	int correct = 0;
	for(int circuit_idx = 0; circuit_idx < 6; ++circuit_idx) {
		auto x = quad_to_bits(flag.substr(4*circuit_idx, 4));
		bool success = evaluate(x, circuit_idx);
		correct += success;
	}
	if(correct == 6) {
		cout << "Correct!" << endl;
	}
	else{
		cout << "Incorrect!" << endl;
	}
	return 0;
}
